import { Button } from "bootstrap";
import { useDispatch, useSelector } from "react-redux";
import { setShowSplitView } from "../redux/actions/actions";
import "./SplitView.css";
const SplitView = () => {

    const dispatch = useDispatch();

    const showSplitView = useSelector(
      (state) => state.showSplitView.showSplitView
    );

    const handleClose = () => {
      dispatch(setShowSplitView(false));
    };

    return(
        <>
            <div>
            <Modal
          show={showSplitView}
          onHide={handleClose}
          backdrop="static"
          keyboard={false}
          centered
          contentClassName="split-wrap"
        >
          <Modal.Body>
            <div>hi</div>
            <Button
              variant="btn col-12 close-btn"
              onClick={handleClose}
            ></Button>
          </Modal.Body>
        </Modal>
            </div>
        </>
    )
}
export default SplitView;
